import {Component, OnInit} from '@angular/core';
import {AuthService} from "../../_services/auth.service";
import {User, UserType} from "../../_models/user";
import {Router} from "@angular/router";
import {FormBuilder, FormGroup, Validators} from "@angular/forms";
import {MatDialogRef} from "@angular/material/dialog";

@Component({
  selector: 'app-create-user',
  templateUrl: './create-user.component.html',
  styleUrls: ['./create-user.component.css']
})
export class CreateUserComponent implements OnInit
{
  defaultAvatar = 'data:image/png;base64,';
  userFormGroup: FormGroup;
  error: any;

  constructor (private authService: AuthService,private dialogRef: MatDialogRef<CreateUserComponent>, private router: Router, private formBuilder: FormBuilder)
  {
  }

  ngOnInit (): void
  {
    this.createForm();
  }

  createForm ()
  {
    let emailRegex: RegExp = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
    this.userFormGroup = this.formBuilder.group({
      'Email': [null, [Validators.required, Validators.pattern(emailRegex)]],
      'Password': [null, [Validators.required, this.checkPassword]],
      'FirstName': [null, [Validators.required]],
      'LastName': [null, [Validators.required]],
      'DisplayName': [null, [Validators.required]],
      'Avatar': [this.defaultAvatar],
    });
  }

  checkPassword (control)
  {
    let enteredPassword = control.value
    let passwordCheck = /^(?=.*[a-z])(?=.*[A-Z])(?=.*[0-9])(?=.{8,})/;
    return (!passwordCheck.test(enteredPassword) && enteredPassword) ? {'requirements': true} : null;
  }

  create (value:any)
  {
    let user: User = {
      email: value.Email,
      password: value.Password,
      avatar: value.Avatar,
      firstName: value.FirstName,
      lastName: value.LastName,
      displayName: value.DisplayName
    };

    this.authService.createUser(user).subscribe(user =>
    {
      console.log(user);
      if (user)
      {
        this.authService.AuthenticateUser({email: value.Email, password: value.Password}).subscribe(loggedIn =>
        {
          if (loggedIn != null)
          {
            console.log('authed user');
            this.dialogRef.close();
            this.router.navigate(['dashboard']);
          } else
          {
            this.error = true;
            console.log('Error');
          }
        });
      }
    });
  }
}
